import React from 'react';
import '../App.css';
import { Button } from './Button';
import './Agile.css';

function AgileSection() {
  return (
    <div className='agile-container'>
      <div className='agile-project-container'>


<h3>Agile Project Tracker (First released March 2020)</h3>
<br />
<br />
<img src='images/Agile.jpeg'/>
<br />
<p><b>Summary</b> : This website is designed to be an easy way to store and manage project Epics and Stories.  Developed using Python, Django, PostgreSQL and launched using Heroku.
</p>
<br />
<a href="https://agile-project-tracker.herokuapp.com/tracker/">https://agile-project-tracker.herokuapp.com/tracker/</a>
    </div>
      </div>
  );
}

export default AgileSection;
